INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (20063115, 10118, 2834, 2, 7, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 91002, "フリーマーケット会場", "青空の下で謁見", 5118061, 8, 0, 40, 1, "ペコリーヌとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (20063115, 10118, 2835, 2, 7, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 91002, "フリーマーケット会場", "未来の騎空団\nマスコット？", 5118062, 8, 0, 40, 1, "マホとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (20063115, 10118, 2837, 2, 7, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 91002, "ランドソル市街地", "お嬢さまからの\n緊急依頼", 5118063, 8, 0, 40, 1, "アキノとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (20063115, 10118, 4108402, 2, 18, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 91002, "フリーマーケット会場", "黄金色の悩みごと", 5118064, 8, 0, 40, 1, "ジュンとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (20063115, 10118, 4107402, 2, 18, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 91002, "フリーマーケット会場", "白熱！　格闘大会！", 5118065, 8, 0, 40, 1, "カオリとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (20063115, 10118, 9000227, 2, 16, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 91002, "オーエド町", "祭り太鼓はオーエドの華", 5118066, 8, 1, 40, 1, "ニノンとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (20063115, 10118, 2101181, 3, 19, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 91002, "フリーマーケット会場", "人気者は遅れて\nやってくる", 5118067, 8, 0, 40, 1, "スズナとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (20063115, 10118, 4109402, 3, 18, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 91002, "ランドソル市街地", "巫女・ミーツ・魔法少女", 5118068, 8, 0, 40, 1, "ナナカとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (20063115, 10118, 4305402, 3, 18, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 91002, "フリーマーケット会場", "ネズ耳は二度なくなる", 5118069, 8, 0, 40, 1, "キャル＆コッコロとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (20063115, 10118, 4101402, 3, 18, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 91002, "ランドソル市街地", "この出会いにカンパイ！", 5118070, 8, 0, 40, 1, "ユカリとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (20063115, 10118, 4106402, 3, 18, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 91002, "ランドソル市街地", "陰陽アンサンブル", 5118071, 8, 0, 40, 1, "アオイとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (20063115, 10118, 2836, 3, 7, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 91002, "フリーマーケット会場", "運試し十番勝負！", 5118072, 8, 1, 40, 1, "シノブとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (20063115, 10118, 0, 1, 0, 0, 0, 0, "彼女たちの新たな日常", 5118600, 0, 0, 0, 0, "オープニング");
